/*
 * Evaluate Reverse Polish Notation
 *
 * We'll need stack so that we can evaluate the Reverse Polish Notation
 * (1) -> implement stack(using array), provide push(), pop(), top()
 * (2) -> use the stack to do the calculation 
 */

#include <stdio.h>
#include <stdlib.h>
#include <string.h>

typedef struct stack_s {
    int *data;
    int top;    // current top pointer
    int cap;    // capacity
} mystack_t;

int init_stack(mystack_t *s, int num)
{
    s->data = malloc(sizeof(int) * num);
    s->cap = num;
    s->top = -1;
    return 0;
}

void _push(mystack_t *s, int element)
{
    if (s->top + 1>= s->cap) {
        // need to double the capacity
        int *new_data;
        int old_num = s->cap;
        s->cap *= 2;
        new_data = malloc(sizeof(int) * s->cap);
        if (new_data == NULL) {
            return;
        }
        memcpy(new_data, s->data, sizeof(int)*old_num);
        free(s->data);
        s->data = new_data;
    }
    s->top ++;
    s->data[s->top] = element;
    printf("pushing element(top=%d)=%d\n", s->top, s->data[s->top]);
}

int _pop(mystack_t *s)
{
    if (s->top == -1) {
        return -1;
    } else {
        printf("poping element(top=%d)=%d\n", s->top,s->data[s->top]);
        return s->data[s->top--];
    }
}

int _top(mystack_t *s)
{
    if (s->top == -1) {
        return -1;
    }
    return s->data[s->top];
}

int evalRPN(char **tokens, int tokenSize)
{
    mystack_t stack;
    int result;
    int err = init_stack(&stack, tokenSize);
    if (err == -1) {
        return -1;
    }
    printf("token size = %d\n", 32);
    for (int i = 0; i < tokenSize; i++) {
        char *op = tokens[i];
        printf("---> found op = %s\n", op);
        if (op[0] == '+') {
            int operand1 = _pop(&stack);
            int operand2 = _pop(&stack);
            result = operand2 + operand1;
            _push(&stack, result);
        } else if (op[0] == '-' && strlen(op) == 1) {
            int operand1 = _pop(&stack);
            int operand2 = _pop(&stack);
            result = operand2 - operand1;
            _push(&stack, result);
        } else if (op[0] == '*') {
            int operand1 = _pop(&stack);
            int operand2 = _pop(&stack);
            result = operand1 * operand2;
            _push(&stack, result);
        } else if (op[0] == '/') {
            int operand1 = _pop(&stack);
            int operand2 = _pop(&stack);
            // we should check divide by zero
            result = operand2 / operand1;
            _push(&stack, result);
        } else if (op[0] >= '0' && op[0] <= '9') {
            _push(&stack, atoi(op));
        } else {
            // illegal input
        }
    }
    return _pop(&stack);
}

